const roots = (
  < BrowserRouter >
      <div>
         <ul>
          <li>
              <Link to="/">Home</Link>
            </li>
            <li>
               <Link to="/Editor ">Users</Link>
            </li>
         </ul>
         <Route exact path="/" component={App} />
         <Route path="/aboutus" component={AboutUs} />
         <Route path="/contactus" component={ContactUs} />
      </div>
   </ BrowserRouter >
);
ReactDOM.render(routs, document.getElementById('root'))

function App() {


    return (
        <div  >
          {/* <EditorFinal /> */}
